    t[514] = "See the FAQ for a list of subscription URLs.";
    t[515] = "\u0394\u03b5\u03af\u03c4\u03b5 \u03c4\u03b9\u03c2 \u03a3\u03c5\u03bd\u03ae\u03b8\u03b5\u03b9\u03c2 \u0395\u03c1\u03c9\u03c4\u03ae\u03c3\u03b5\u03b9\u03c2 \u03b3\u03b9\u03b1 \u03bc\u03b9\u03b1 \u03bb\u03af\u03c3\u03c4\u03b1 \u03bc\u03b5 \u03b4\u03b9\u03b5\u03c5\u03b8\u03cd\u03bd\u03c3\u03b5\u03b9\u03c2 URL \u03c3\u03c5\u03bd\u03b4\u03c1\u03bf\u03bc\u03ae\u03c2.";
