    t[528] = "all";
    t[529] = "\u03b5\u03ba\u03ba\u03b1\u03b8\u03ac\u03c1\u03b9\u03c3\u03b7 \u03c6\u03af\u03bb\u03c4\u03c1\u03bf\u03c5";
