    t[577] = "\u0394\u03b9\u03b1\u03b3\u03c1\u03b1\u03c6\u03ae \u0395\u03c0\u03b9\u03bb\u03b5\u03b3\u03bc\u03ad\u03bd\u03c9\u03bd";
